import React from 'react';
import './Dashboard.css'; // Import your stylesheet

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h1>OVERVIEW</h1>
      
      <section className="priority-tasks">
        <h2>PRIORITY TASKS</h2>
        {/* You would render your tasks here, potentially using a Task component */}
      </section>
      
      <section className="analytics-and-calendar">
        <div className="task-analytics">
          <h2>TASK ANALYTICS</h2>
          {/* Placeholder for the task analytics chart */}
          <div className="analytics-placeholder">Chart Placeholder</div>
        </div>
        
        <div className="calendar">
          <h2>CALENDAR</h2>
          {/* Placeholder for the calendar */}
          <div className="calendar-placeholder">Calendar Placeholder</div>
        </div>
      </section>
      
      <div className="view-reports">
        <button>View reports here</button>
      </div>
    </div>
  );
};

export default Dashboard;
